import React, { Component } from 'react';
import BarCharts from './components/barCharts';
import axios from 'axios';

class App extends Component {
    constructor(props){
        super(props);
        this.state = {neoData : {}}
    }

    componentDidMount(){
        axios.get('https://api.nasa.gov/neo/rest/v1/neo/browse?api_key=DEMO_KEY')
            .then(res => {
                this.setState({neoData : res});
                console.log(this.state.neoData);
            })
    }

  render() {
    return (
      <div>
        <h1>Hello Botify !</h1>
            <BarCharts neoData={this.state.neoData}/>
      </div>
    );
  }
}

export default App;
